from testbase import TestBase
import pandas as pd
from io import BytesIO
from leframework.model.states.segmentationgenerator import RevenueSegmentationGenerator, SegmentationGenerator, \
    EVSegmentationGenerator
from leframework.model.mediator import Mediator
import json


class SegmentationGeneratorTest(TestBase):

    def setUp(self):
        self.revenuegenerator = RevenueSegmentationGenerator()
        self.generator = SegmentationGenerator()
        self.evgenerator = EVSegmentationGenerator()
        self.mediator = self.loadMediator()
        self.revenuegenerator.setMediator(self.mediator)
        self.generator.setMediator(self.mediator)
        self.evgenerator.setMediator(self.mediator)

    def testExecute(self):
        self.generator.execute()
        assert len(self.mediator.segmentations[0]["Segments"]) == 100

    def testRevenueExecute(self):
        self.revenuegenerator.execute()
        assert len(self.mediator.revenuesegmentations[0]["Segments"]) == 100

    def testEVExecute(self):
        self.evgenerator.execute()
        assert len(self.mediator.evsegmentations[0]["Segments"]) == 100


    def loadMediator(self):
        mediator = Mediator()
        mediator.revenueColumn = "revenue"
        mediator.schema = dict()
        mediator.schema["target"] = "Event"
        mediator.schema["reserved"] = dict()
        mediator.schema["reserved"]["score"] = "probScore"
        mediator.schema["reserved"]["predictedrevenue"] = "revScore"
        mediator.data = self.load_revenue_data_frame()
        mediator.score_derivation = self.load_score_derivation()
        mediator.revenue_score_derivation = self.load_revenue_score_derivation()
        mediator.fit_function_parameters = self.load_fit_function_parameter()
        mediator.revenue_fit_function_parameters = self.load_revenue_fit_function_parameter()
        return mediator

    def load_revenue_data_frame(self):
        buffer = self.load_revenue_score_data()
        df = pd.read_csv(BytesIO(buffer), header=0)
        return df

